import styled from 'styled-components';

const CreateUserWrapper = styled.div`
  align-items: center;
  display: flex;
  flex-direction: column;
  margin-top: 10px;
  text-align: center;
`;

const UserNameInput = styled.input`
  font-size: 14px;
  height: 40px;
  padding: 0 15px;
  width: 300px;
`;

const CreateUserButton = styled.button`
  background-color: #28bcf7;
  border-radius: 3px;
  color: white;
  font-size: 16px;
  font-weight: bold;
  height: 30px;
  margin-left: 16px;
  width: 200px;
`;

export {
  CreateUserWrapper,
  UserNameInput,
  CreateUserButton,
}
